// import logo from './logo.svg';
import './App.css';
import Profile from './components/Profile/socialProfile';
import user from './user.json';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Profile avatar={user.avatar} name={user.name} tag={user.tag} location={user.location} followers={user.location} />
      </header>
    </div>
  );
}

export default App;
